import React from 'react';
import ReactECharts from 'echarts-for-react';

const Heatmap = () => {
    const option = {
        tooltip: {
            position: "top"
        },
        animation: false,
        grid: {
            height: "50%",
            top: "10%"
        },
        xAxis: {
            type: "category",
            data: ["12a", "1a", "2a", "3a", "4a", "5a", "6a", "7a", "8a", "9a", "10a", "11a", "12p", "1p", "2p", "3p", "4p", "5p", "6p", "7p", "8p", "9p", "10p", "11p"],
            splitArea: {
                show: true
            }
        },
        visualMap: {
            min: 0,
            max: 10,
            calculable: true,
            orient: "horizontal",
            left: "center",
            bottom: "15%"
        },
        series: [{
            name: "Punch Card",
            type: "heatmap",
            data: [1,2,3,4,5
            ]
        }]
    }

    return <ReactECharts option={option} style={{ height: 600 , width: "1000px"}}/>;
};
export default Heatmap;
